book = xlwt.Workbook(encoding="utf-8")

sheet1 = book.add_sheet("Sheet 1")

mat = [[0 for _ in range(len(forks_count))] for _ in range(len(forks_count))]

for i in range (len(forks_count)):
    for j in range(len(forks_count)):
        mat[i][j] = 0

bb = forks_count[:]

cc = sorted(bb)

for i in range(len(forks_count)):
    ind = cc.index(forks_count[i])
    mat[i][ind] = forks_count

for i in range (len(forks_count)):
    for j in range(len(forks_count)):
        sheet1.write(i, j, mat[i][j])

book.save("t.xls")
